const AchievementTracker = () => {
  const inProgressItem = {
    title: "운동 가기 챌린지",
    progress: 7,
    total: 7,
    completed: true
  };

  const availableItems = [
    { title: "양치 챌린지", progress: 0, total: 7 },
    { title: "운동 챌린지", progress: 0, total: 7 },
    { title: "식단 챌린지", progress: 0, total: 7 }
  ];

  const ProgressDots = ({ progress, total, completed }) => (
    <div className="flex gap-1">
      {[...Array(total)].map((_, i) => (
        <div
          key={i}
          className={`w-2 h-2 rounded-full ${
            i < progress ? 'bg-teal-500' : 'bg-gray-200'
          }`}
        />
      ))}
    </div>
  );

  return (
    <div className="max-w-md mx-auto p-4 bg-white">
      <div className="text-xl font-bold mb-6">습관</div>
      
      {/* In Progress Section */}
      <div className="mb-8">
        <div className="text-lg font-medium mb-4">참여중</div>
        <div className="bg-gradient-to-r from-teal-400 to-blue-400 rounded-lg p-4 text-white">
          <div className="flex justify-between items-center">
            <span>{inProgressItem.title}</span>
            <span className="text-sm">{inProgressItem.progress}/{inProgressItem.total}</span>
          </div>
          <ProgressDots 
            progress={inProgressItem.progress} 
            total={inProgressItem.total} 
            completed={inProgressItem.completed}
          />
        </div>
      </div>

      {/* Available Challenges Section */}
      <div>
        <div className="text-lg font-medium mb-4">참여 가능</div>
        <div className="space-y-3">
          {availableItems.map((item, index) => (
            <div key={index} className="flex items-center justify-between bg-white border rounded-lg p-4">
              <div className="flex-1">
                <div className="mb-2">{item.title}</div>
                <ProgressDots 
                  progress={item.progress} 
                  total={item.total} 
                  completed={false}
                />
              </div>
              <button className="px-4 py-2 bg-teal-500 text-white rounded-md">도전</button>
            </div>
          ))}
        </div>
      </div>

      {/* Bottom Navigation */}
      <div className="fixed bottom-0 left-0 right-0 bg-white border-t flex justify-around py-4">
        <Calendar className="text-gray-400 w-6 h-6" />
        <Medal className="text-gray-400 w-6 h-6" />
        <div className="bg-teal-500 p-3 rounded-full -mt-8">
          <Camera className="text-white w-6 h-6" />
        </div>
        <MessageCircle className="text-gray-400 w-6 h-6" />
        <User className="text-gray-400 w-6 h-6" />
      </div>
    </div>
  );
};

export default AchievementTracker;
